import React from 'react'

function JobList() {
    const jobs = ["Lawson", "Shaw", "New"];
    const items = [];

    for (let job of jobs) {
        items.push(job);
    }

    return (
    <div>
        <ul>{items}</ul>
    </div>)
}

export default JobList
